                                    <script>
                                        document.addEventListener('DOMContentLoaded', function() {
                                            const tabs = document.querySelectorAll('.rprofile_menu .item');
                                            const contentSections = document.querySelectorAll('.rprofile_tab_item');

                                            tabs.forEach(tab => {
                                                tab.addEventListener('click', function() {
                                                    // Remove active class from all tabs
                                                    tabs.forEach(t => t.classList.remove('active'));
                                                    // Add active class to the clicked tab
                                                    this.classList.add('active');

                                                    // Hide all content sections
                                                    contentSections.forEach(section => {
                                                        section.style.display = 'none';
                                                    });

                                                    // Get the corresponding content section's ID
                                                    const targetId = this.textContent.trim().toLowerCase().replace(/\s+/g, '_');
                                                    console.log("Target ID: ", targetId); // Debugging line
                                                    const targetSection = document.getElementById(targetId);

                                                    // Show the corresponding content section
                                                    if (targetSection) {
                                                        targetSection.style.display = 'block';
                                                    } else {
                                                        console.error("No section found for ID: ", targetId); // Debugging line
                                                    }
                                                });
                                            });

                                            // Activate the first tab by default
                                            if (tabs.length > 0) {
                                                tabs[0].click();
                                            }
                                        });
                                    </script>
                                </div>
                            </div>
                        </main>
                    </div>
                </div>
            </main>
